function UserInput() {
const [guess, setGuess] = useState('')

const addGuess = (event) => {
  setGuess(event.target.value)
}


  return (
    <form action="">
        <input onChange={addGuess}type="text" />
        <p>{guess}</p>
        <button className="guess">Guess</button>
      </form>
  )
}

export default UserInput
